import React from 'react';
import styled from 'styled-components';
import { MdModeEdit, MdDelete } from 'react-icons/md';

const Remove = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  font-size:24px;
  cursor: pointer;
  `
const Edit = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  font-size:24px;
  cursor: pointer;
`
const Cost = styled.div`
  /* font-size: 14px; */
  color: #c92a2a;
  margin-right: 10px;
`

const Contents = styled.div`
  /* font-size: 14px; */
  margin-right: 100px;
`
const FilterItem = styled.div`
  background: #f3d9fa;
  padding: 10px;
  border-radius: 5px;
  display: flex;
  align-items: center;
  justify-content: center;
  /* margin-right: 10px; */
`
const ExpenditureItemBlock = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding-top:12px;
  padding-bottom: 12px;
  border: 1px solid brown;

`

function ExpenditureItem() {
  return (
    <ExpenditureItemBlock>
     <FilterItem>식사</FilterItem>
     <Contents>용개반점</Contents>
     <Cost>-7000원</Cost>
     <Edit>
       <MdModeEdit />
     </Edit>
     <Remove>
       <MdDelete />
     </Remove>
    </ExpenditureItemBlock>
  )
}
export default ExpenditureItem;
